pub enum Axis {
    Emulated {
        pos: Button,
        neg: Button,
    },
    MouseMotion {
        axis: MouseAxis,
        limit: bool,
        radius: ordered_float::NotNan<f32>,
    },
    RelativeMouseMotion {
        axis: MouseAxis,
        limit: bool,
        radius: ordered_float::NotNan<f32>,
    },
    MouseWheel {
        axis: MouseAxis,
    },
}

pub enum Button {
    Key(winit::event::VirtualKeyCode),
    ScanCode(u32),
    Mouse(winit::event::MouseButton),
}
